@Test
public void testScalability() throws Exception {
	PossibilityIterator iter = new PossibilityIterator(lotsaSuggestions, 1000, 10000);
	int count = 0;
	while (iter.hasNext()) {			
		RankedSpellPossibility rsp = iter.next();
		count++;
	}
	assertTrue(count==1000);
}

